import { Link } from "react-router-dom";

function Navigation() {
  return (
    <nav className="border-b-4 border-choco flex justify-end bg-whiteWeak font-me">
      <div className="border-l-4 border-choco py-2 px-8">
        <Link to='/summary'>Summary</Link>
      </div>
      <div className="border-l-4 border-choco py-2 px-8">
        <Link to="/assign">Identification</Link>
      </div>
      <div className="border-l-4 border-choco py-2 px-8">
        <Link to="/validator">Detect Validity</Link>
      </div>
    </nav>
  );
}

export default Navigation;
